  l.analysis_type = "histogram"
  l.name = "Sea Surface Temperature (2011)"
  l.info = "{\"description\":\"The sea level rise pressure layer is derived from satellite altimetry data (http://www.aviso.altimetry.fr/en/data/products/sea-surface-height-products/global/msla-mean-climatology.html). Monthly mean sea level anomalies since 1993 track changes in sea level (mm) compared to a reference period from 1993-2012. Raw monthly data are provided on a 0.25x0.25 degree grid. These data were clipped to within 3 nautical miles of the coast, and monthly data layers were aggregated and averaged across pixels to compute mean sea level anomalies. The 99.99th quantile of raster values from all years was used as the reference point to rescale the layer from 0 to 1. All negative values were set to zero (i.e., no negative pressure), such that only positive sea level rise values mattered. The mean value of the raster cells within each OHI region was calculated.\",\"source\":\"Ocean Health Index. 2017. ohi-global version: Global scenarios data for Ocean Health Index, June 6, 2019. National Center for Ecological Analysis and Synthesis, University of California, Santa Barbara. Available at: https://rawgit.com/OHI-Science/ftp_data/master/data_list.html\",\"link\":\"https://rawgit.com/OHI-Science/ftp_data/master/data_list.html\"}"
  l.legend = "{ \"min\": \"0\", \"max\": \"1\", \"unit\": \"g/km2\", \"type\": \"choropleth\", \"bucket\": [\r\n\"#5e4fa2\",\r\n\"#3288bd\",\r\n\"#66c2a5\",\r\n\"#abdda4\",\r\n\"#e6f598\",\r\n\"#ffffbf\",\r\n\"#fee08b\",\r\n\"#fdae61\",\r\n\"#f46d43\",\r\n\"#d53e4f\",\r\n\"#9e0142\"] }"
  l.description = "The sea level rise pressure layer is derived from satellite altimetry data (http://www.aviso.altimetry.fr/en/data/products/sea-surface-height-products/global/msla-mean-climatology.html). Monthly mean sea level anomalies since 1993 track changes in sea level (mm) compared to a reference period from 1993-2012. Raw monthly data are provided on a 0.25x0.25 degree grid. These data were clipped to within 3 nautical miles of the coast, and monthly data layers were aggregated and averaged across pixels to compute mean sea level anomalies. The 99.99th quantile of raster values from all years was used as the reference point to rescale the layer from 0 to 1. All negative values were set to zero (i.e., no negative pressure), such that only positive sea level rise values mattered. The mean value of the raster cells within each OHI region was calculated."
  l.data_units = ""
  l.processing = ""
end

